import React from "react";
const Home: React.FC = () => {
  return (
    <>
      <h1>Home Page</h1>
      <ul
        role="list"
        classname="marker:text-sky-400 list-disc pl-5 space-y-3 text-slate-400"
      >
        <li>5 cups chopped Porcini mushrooms</li>
        <li>1/2 cup of olive oil</li>
        <li>3lb of celery</li>
      </ul>
    </>
  );
};

export default Home;
